    return (
        <div className='card'>
        <h4>Order Summary</h4>
        <p>Selected Item: {card.length}</p>
        <p>Total Price: </p>
        <p>Total Shipping: </p>
        <p>Tax: </p>
        <h6>Grand Total: </h6>
        </div>
    );
};

